            "name": "howtoplay.multiplayer.text.7",
            "description": "如果您想要管理各个玩家的权限，玩家权限使其变得非常容易。打开暂停菜单，您会在右侧看到当前在世界中的玩家列表。选择其权限图标可调整该玩家的权限。"
