            "name": "howtoplay.ranching.text.3",
            "description": "当两只同类动物彼此靠近并且都处于“爱情模式”时，它们就会亲吻一会儿，然后生出一只动物宝宝！动物宝宝会与其父母呆在一起直至成年。生完宝宝后，成年动物必须等 5 分钟才能再次进入“爱情模式”。"
