            "name": "howtoplay.realms.text.2",
            "description": "要设置 Realm，请在“世界”选项卡中选择“新建”。然后依次选择“新建 Realm”按钮和“新建世界”按钮。可在此处对您的 Realm 命名，并设置玩家数量。随后即可向 Realm 中添加好友。"
